  true,\n\t\"url\": null,\n\t\"notes\": \"Shapefiles and spreadsheets of structural
  data, including attitudes of faults and strata and slip orientations of faults.n-
  Detailed geologic mapping of ~30 km2 was completed in the vicinity of the Columbus
  Marsh geothermal field to obtain critical structural data that would elucidate the
  structural controls of this field.n- Documenting Eu2010 to ENEu2010striking left
  lateral faults and Nu2010 to NNEu2010striking normal faults.n- Some faults cut Quaternary
  basalts.n- This field appears to occupy a displacement transfer zone near the eastern
  end of a system of leftu2010lateral faults. ENEu2010striking sinistral faults diffuse
  into a system of Nu2010 to NNEu2010striking normal faults within the displacement
  transfer zone.n- Columbus Marsh therefore corresponds to an area of enhanced extension
  and contains a nexus of fault intersections, both conducive for geothermal activity.\",\n\t\"license_title\":
